import React, { memo, useRef, useState, useEffect } from 'react';
import { CSSTransition } from 'react-transition-group';
import { Container, LoginIconWrapper  }  from '../style'
import imgSrc from './netease-music.png'
function LoginPhone() {
    const [show, setShow] = useState(false);

    useEffect(() => {
        setShow(true);
    }, []);


    return (
        <CSSTransition
            in={show}
            timeout={300}
            appear={true}
            classNames="fly"
            unmountOnExit
        >
            <Container>
            <LoginIconWrapper>
          <img src={imgSrc} style={{ width: '100px', height: '100px', }} alt="" />
        </LoginIconWrapper>
            </Container>
        </CSSTransition>
    )
}

export default memo(LoginPhone)
